      const video = document.querySelector('video');
      if (video) {
        results.videoUrl = video.src;
      }

      // Try to find meta tags
      const metaVideoUrl = document.querySelector('meta[property="og:video"]');
      if (metaVideoUrl && !results.videoUrl) {
        results.videoUrl = metaVideoUrl.content;
      }

      // Extract text content from the page
      const textElements = document.querySelectorAll('span, div, p, h1, h2, h3');
      const seenTexts = new Set();

      textElements.forEach(el => {
        const text = el.innerText?.trim();
        if (text && text.length > 0 && text.length < 500 && !seenTexts.has(text)) {
          seenTexts.add(text);
          // Filter out common UI elements
          if (!text.match(/^(Like|Comment|Share|Follow|Following|View|More|Close|Menu|Home|Search|Explore|Reels|Messages|Notifications|Create|Profile)$/i)) {
            results.textOverlays.push(text);
          }
        }
      });

