      const captionElement = document.querySelector('h1') || 
                            document.querySelector('[role="button"] span') ||
                            document.querySelector('div[class*="Caption"]');
      if (captionElement) {
        results.caption = captionElement.innerText?.trim();
      }

      return results;
    });

    console.log('Video data extracted:', JSON.stringify(videoData, null, 2));

    // If we found a video URL, download it
    if (videoData.videoUrl) {
      console.log('Downloading video...');
      const videoPath = path.join(__dirname, '../tmp/instagram-video.mp4');
      try {
        await downloadFile(videoData.videoUrl, videoPath);
        console.log('Video downloaded to:', videoPath);
      } catch (err) {
        console.error('Error downloading video:', err.message);
      }
    }

    return videoData;

  } finally {
    await browser.close();
  }
}

