    }

    fs.writeFileSync(outputPath, output);
    console.log(`\nTranscription saved to: ${outputPath}`);
    console.log('\nContent preview:');
    console.log(output);
  })
  .catch(err => {
    console.error('Error:', err);
    process.exit(1);
  });

